import { Center, Text, VStack, Heading, Box, Button, ButtonGroup  } from '@chakra-ui/react';
import {ReactNode} from "react";

function Vstack(props: { spacing: number, align: string, direction: string, children: ReactNode }) {
    return null;
}

function MyButton() {
    return (
        <Vstack spacing={4} direction='row' align='center'>
            <Button colorScheme='teal' size='lg'>
                LOGIN
            </Button>
        </Vstack>
);
}
const Home = (): JSX.Element => (
    <Center mt="160px">
     <VStack spacing="32px">
      <div>
          <Heading>Artists Book</Heading>
          <Text fontSize='4xl'>Manage your favorite artists</Text>
          <MyButton />
      </div>
     </VStack>
    </Center>
);

export default Home;
